import React, { useState } from "react";
import styles from "./Registration.module.css";
// import { User, AuthenticationService } from "./AuthenticationSingleton.ts";
import Button from "../UI/Button/Button.js";
import myImage from "./AuthenticationPicture.jpg";

const Registration = (props) => {
  return (
    <div className={styles.authenticationBlock}>
      <div className={styles.registryBox}>
        <div className={styles.registryBox__picture}>
          <img src={myImage}></img>
        </div>
        <div>
          <form className={styles.registryBox__form}>
            <h3>Let's Start Today</h3>
            <span>Already have an account? <a href="">Login</a></span>
            <a className={styles.google__link}>
              <img src="https://img.icons8.com/fluency/48/google-logo.png" alt=""></img>
            </a>
          </form>
        </div>
      </div>
    </div>
  );
};
export default Registration;
